//1 is stone, 2 is paper and 3 is scissor
function stone() {
    if (piedra.value) {   
        let x = Math.floor(Math.random() * (max - min + 1) + min);  //random number 
        switch (x) {
            case 1:
                result.innerHTML = "Piedra  <b>VS</b>  Piedra"; 
                final.innerHTML = "<b>EMPATE</b>";
                imagenPlayer.src = "data:image/jpeg;base64,";
                imagenPc.src = "data:image/jpeg;base64,";
                break;
            case 2:
                result.innerHTML = "Piedra  <b>VS</b>  Papel"; 
                final.innerHTML = "<b>PIERDES</b>";
                imagenPlayer.src = "data:image/jpeg;base64,";
                imagenPc.src = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSEU7AehbZH-jCXIuj3SSqPj8Ayyxp33L9aNg&usqp=CAU";
                let lNew = ++l;
                pc.innerHTML = "<b>PC:</b> " + lNew;
                break;
            case 3:
                result.innerHTML = "Piedra  <b>VS</b>  Tijera"; 
                final.innerHTML = "<b>GANAS</b>";
                imagenPlayer.src = "data:image/jpeg;base64,";
                imagenPc.src = "data:image/jpeg;base64,";
                let wNew = ++w;
                human.innerHTML = "<b>Player:</b> " + wNew;
                break;
        }
    }
}
